Шукаємо людину, яка буде:

будувати моделі даних в Cloudera Data Hab (CDH), Cloudera Data Platform (CDP) для аналітиків даних;
аналізувати потреби замовника;
розробляти процедури отримання даних з використанням компонентів CDH (CDP);
реалізовувати розрахунок аналітичних показників на Python;
розробляти процедури автоматизації ETL (ELT)-процесів;
розробляти процедуру отримання і обробки online інформації (Kafka, Spark, Nifi);

Booongo now is an established company with ambitious aspirations and aims, still has a set of funny stories to share from our star-up past. We started five years ago as a team of slot fans, creating products we love and being sure the market would love it as well!

Passion and deep interest in what we do are helping to create a product we are proud of. We find a gambling drive in leaders, thus we are among the strongest providers in the industry. Our professional team claims for new faces filled with successful experiences and a spirit of victory.

Booongo is growing and hiring! Want more and get a lot! Join us!

Requirements:

At least 2+ years of experience working with ES6 / HTML / CSS / Pixi.js/ Tween.js;
Experience in JavaScript ES6+;
Experience in game development;
Knowledge of Git;
Understanding the Model-View-Controller (MVC) Architecture.
As a plus:

Ability to work with gulp;
Experience with Spine animations.
We offer:

Friendly and inspiring environment in a team of professionals;
Freedom to express yourself and opportunity of personal professional growth;
Work on interesting projects;
Remote work;
Medical Insurance for Covid-19 related situations;
Online Corporate English classes ;
Trainings and team-buildings.
Responsibilities:

Creating browser-based HTML5 slot games for desktop and mobile devices;
Performance optimization for various devices.
